import React from 'react';
import { Card, Button } from 'semantic-ui-react'

const PostCard = (props) => {
  const { post } = props;
  return (
  <Card>
    <Card.Content header={post.title} />
    <Card.Content description={post.body} />
    <Card.Content extra>
      <Icon name='user' />4 Friends
    </Card.Content>
  </Card>
  );
}

export default PostCard;
